import React from 'react';
import App from './App';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Link } from "react-router-dom";

ReactDOM.render(

    <Router>
        <Routes>
            <Route path='/' element='App'></Route>
        </Routes>
    </Router>


,document.getElementById('root'));
